import React from 'react';
import DashboardLayout from '../components/Layouts/DashboardLayout';
import StatsCard from '../components/Dashboard/StatsCard';
import RecentDiagnosesTable from '../components/Dashboard/RecentDiagnosesTable';

const DashboardPage = () => {
    const stats = [
        {
            title: 'Total Diagnoses',
            value: '1,248',
            icon: 'ðŸ“¸',
            color: 'bg-blue-50 text-blue-600',
            trend: { value: '12%', isPositive: true }
        },
        {
            title: 'Healthy Plants',
            value: '856',
            icon: 'ðŸŒ¿',
            color: 'bg-green-50 text-green-600',
            trend: { value: '5%', isPositive: true }
        },
        {
            title: 'Diseases Detected',
            value: '392',
            icon: 'ðŸ¦ ',
            color: 'bg-red-50 text-red-600',
            trend: { value: '2%', isPositive: false }
        },
        {
            title: 'Avg. Confidence',
            value: '94.2%',
            icon: 'ðŸŽ¯',
            color: 'bg-purple-50 text-purple-600',
            trend: { value: '0.8%', isPositive: true }
        }
    ];

    return (
        <DashboardLayout>
            <div className="mb-8">
                <h1 className="text-3xl font-extrabold text-gray-900">
                    Welcome Back, <span className="text-transparent bg-clip-text bg-gradient-to-r from-pink-500 to-yellow-500">Farmer</span>
                </h1>
                <p className="text-gray-500 mt-2">Here's what's happening with your crops today.</p>
            </div>

            {/* Stats Grid */}
            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6 mb-8">
                {stats.map((stat, index) => (
                    <StatsCard key={index} {...stat} />
                ))}
            </div>

            {/* Main Content Grid */}
            <div className="grid grid-cols-1 lg:grid-cols-3 gap-8">
                {/* Left Column: Recent Diagnoses Table */}
                <div className="lg:col-span-2">
                    <RecentDiagnosesTable />
                </div>

                {/* Right Column: Quick Actions or Additional Info */}
                <div className="space-y-6">
                    {/* Quick Upload Card */}
                    <div className="bg-gradient-to-br from-gray-900 to-gray-800 rounded-3xl p-6 text-white shadow-xl">
                        <h3 className="text-xl font-bold mb-2">New Diagnosis</h3>
                        <p className="text-gray-400 text-sm mb-6">Upload a photo to check for diseases instantly.</p>

                        <button className="w-full py-3 bg-gradient-to-r from-pink-400 to-yellow-400 rounded-xl text-gray-900 font-bold hover:opacity-95 transition-opacity flex items-center justify-center gap-2">
                            <span>ðŸ“¸</span> Upload Photo
                        </button>
                    </div>

                    {/* Disease Distribution (Placeholder for Pie Chart) */}
                    <div className="bg-white rounded-3xl p-6 shadow-sm border border-gray-100">
                        <h3 className="text-lg font-bold text-gray-800 mb-4">Disease Distribution</h3>
                        <div className="h-48 flex items-center justify-center bg-gray-50 rounded-xl border border-dashed border-gray-200">
                            <p className="text-gray-400 text-sm">Chart Visualization</p>
                        </div>
                    </div>
                </div>
            </div>
        </DashboardLayout>
    );
};

export default DashboardPage;
